import React from "react";
import reactDOM from "react-dom";
import "bootstrap/dist/css/bootstrap.css";


const Component = () => {
    return <h1>Weather forecast</h1>;
};

const App = () => {
    return <Component />
}

reactDOM.render(<App />, document.getElementById("root"));
